import React, { useState, useEffect } from 'react';
import { Container, Paper, Typography, Button, Box } from '@mui/material';
import { feedbackAPI, courseAPI, adminAPI } from '../services/api';

const DebugData = () => {
  const [debugInfo, setDebugInfo] = useState({
    courses: [],
    feedback: [],
    users: []
  });

  const checkData = async () => {
    try {
      console.log('üîç Checking database data...');
      
      // Check courses
      try {
        const coursesResponse = await courseAPI.getCourses();
        console.log('üìö Courses:', coursesResponse.data);
        setDebugInfo(prev => ({ ...prev, courses: coursesResponse.data.courses }));
      } catch (error) {
        console.error('‚ùå Courses error:', error);
      }

      // Check feedback
      try {
        const feedbackResponse = await feedbackAPI.getAllFeedback({ limit: 5 });
        console.log('üí≠ Feedback:', feedbackResponse.data);
        setDebugInfo(prev => ({ ...prev, feedback: feedbackResponse.data.feedback }));
      } catch (error) {
        console.error('‚ùå Feedback error:', error);
      }

      // Check users
      try {
        const usersResponse = await adminAPI.getUsers({ limit: 5 });
        console.log('üë• Users:', usersResponse.data);
        setDebugInfo(prev => ({ ...prev, users: usersResponse.data.users }));
      } catch (error) {
        console.error('‚ùå Users error:', error);
      }

    } catch (error) {
      console.error('‚ùå Debug check failed:', error);
    }
  };

  useEffect(() => {
    checkData();
  }, []);

  return (
    <Container maxWidth="lg" sx={{ mt: 4 }}>
      <Paper sx={{ p: 3 }}>
        <Typography variant="h4" gutterBottom>
          üêõ Debug Data Check
        </Typography>
        
        <Button onClick={checkData} variant="contained" sx={{ mb: 3 }}>
          Refresh Data Check
        </Button>

        <Box sx={{ mb: 3 }}>
          <Typography variant="h6">üìö Courses ({debugInfo.courses.length})</Typography>
          <pre style={{ background: '#f5f5f5', padding: '10px', overflow: 'auto' }}>
            {JSON.stringify(debugInfo.courses, null, 2)}
          </pre>
        </Box>

        <Box sx={{ mb: 3 }}>
          <Typography variant="h6">üí≠ Feedback ({debugInfo.feedback.length})</Typography>
          <pre style={{ background: '#f5f5f5', padding: '10px', overflow: 'auto' }}>
            {JSON.stringify(debugInfo.feedback, null, 2)}
          </pre>
        </Box>

        <Box sx={{ mb: 3 }}>
          <Typography variant="h6">üë• Users ({debugInfo.users.length})</Typography>
          <pre style={{ background: '#f5f5f5', padding: '10px', overflow: 'auto' }}>
            {JSON.stringify(debugInfo.users, null, 2)}
          </pre>
        </Box>
      </Paper>
    </Container>
  );
};

export default DebugData;
